import ReviewItem from "./ReviewsItem";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
export default function ReviewList(){

    const settings = {
        dots: false,
        infinite: false,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };

    return(
        <div>
            <h2> Single Item</h2>
            <Slider {...settings}>
                <ReviewItem/>
                <ReviewItem/>
                <ReviewItem/>
            </Slider>
        </div>

    )
}
